		<script>
			const IMAGE_DUMMY = 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAAAXNSR0IArs4c6QAAAERlWElmTU0AKgAAAAgAAYdpAAQAAAABAAAAGgAAAAAAA6ABAAMAAAABAAEAAKACAAQAAAABAAAAAaADAAQAAAABAAAAAQAAAAD5Ip3+AAAAC0lEQVQIHWNgAAIAAAUAAY27m/MAAAAASUVORK5CYII=';

			function $(selector, root) {
				return (root || document).querySelector(selector);
			}

			function $$(selector, root) {
				return (root || document).querySelectorAll(selector);
			}

			var index = 0;
			var resultIndex = -1;
			var image_loaded = false;

			var map = [
				{
					prepare: function () {
						$$('.page').forEach(page => {
							page.style.display = 'none';
						});
						$('#page1').style.display = 'flex';
						$('#home').style.display = 'none';
					},
					action: function () {
						$('#page1').classList.add('hide');
						setTimeout(() => {
							move(1);
						}, 500)
					}
				},
				{
					prepare: function () {
						$$('.page').forEach(page => {
							page.style.display = 'none';
						});

						$('#page2').style.display = 'flex';
						$('#home').style.display = 'none';

						if (!image_loaded) {
							$('#btn2').disabled = 'disabled';
							$('#clear').style.display = 'none';
							talk(2, '向着星辰与深渊！在出发之前，请先上传一张您的正面半身像，创建您的数字分身。')
						} else {
							$('#btn2').disabled = '';
							$('#btn2').innerHTML = '立即出发';
							talk(2, '久等了！您的数字分身已经正式创建完毕！现在您可以穿越任意门，开启激动人心的旅行了！祝您好运！')
						}
					},
					action: function () {
						$('#btn2').innerHTML = '<div class="lds-dual-ring"></div> 穿越中..';
						setTimeout(() => {
							move(2);
						}, 1000 * 10);
					}
				},
				{
					prepare: function () {
						$$('.page').forEach(page => {
							page.style.display = 'none';
						});

						$('#page3').style.display = 'flex';
						$('#home').style.display = 'block';

						result  = pickupResult();

						$('#result').src = result.src;
						talk(3, result.narration);
						$('#btn3').innerHTML = '前往下一站';

					},
					action: function () {
						$('#btn3').innerHTML = '<div class="lds-dual-ring"></div> 穿越中..';
						setTimeout(() => {
							move(2);
						}, 1000 * 10);
					}
				}
			];

			function processingInput(data, callback) {
				var titles = [
					'图片上传中..',
					'文件完整性检查中..',
					'图像全局扫描中..',
					'人物主体提取中..',
					'正在创建面部特征索引..',
					'正在强化局部特征数据..',
					'正在构建人物向量矩阵..',
					'正在封装模型数据文件..',
					'模型文件加载中..',
					'马上就好..'
				];

				$('#input').src = data;
				image_loaded = true;
				$('#input').style.filter = 'brightness(0.25)';
				$('#progress').style.display = 'block';
				$('#progress .bar').style.width = '0%';

				var steps = 100;
				var i = 0;

				(function next() {
					i += 1;
					$('#progress .bar').style.width = i + '%';
					$('#progress').setAttribute('data-title', titles[Math.floor(i / 10)]);
					if (i < 100) {
						setTimeout(next, 600)
					} else {
						$('#progress').style.display = 'none';
						$('#input').style.filter = '';
						callback();
					}
				}());
			}

			function talk(index, message) {
				$('#narration' + index).classList.remove('show');
				setTimeout(() => {
					$('#narration' + index).innerHTML = message;
					$('#narration' + index).classList.add('show');
				}, 200);
			}

			function pickupResult() {
				var len = resultDB.length;

				if (++resultIndex == len) {
					resultIndex = 0;
				}

				return resultDB[resultIndex];
			}

			function move(to) {
				index = to;
				map[index].prepare();
			}

			function readFile(file, callback) {
				var reader = new FileReader();

				reader.onloadend = function () {
					callback(reader.result, file.type);
				}

				reader.onerror = function () {
					alert('There was an error reading the file!');
				}

				reader.readAsDataURL(file);
			}

			function init() {
				$('body').onclick = function (e) {
					console.log(e.target);

					if (e.target.nodeName == 'BUTTON') {
						console.log(index, 'action')
						map[index].action();
					} else if (e.target.id == 'input') {
						if (!image_loaded) {
							$('#uploader').click();
						}
					} else if (e.target.id == 'home') {
						move(1);
					} else if (e.target.id == 'clear') {
						$('#input').src = IMAGE_DUMMY;
						image_loaded = false;
						$('#btn2').disabled = 'disabled';
						$('#uploader').value = '';
						$('#clear').style.display = 'none';
						talk(2, '向着星辰与深渊！在出发之前，请先上传一张您的正面半身像，创建您的数字分身。')
					}
				}

				$('#uploader').onchange = function (e) {
					var file = e.target.files[0];
					readFile(file, function (data, type) {
						processingInput(data, function () {
							$('#btn2').disabled = '';
							$('#clear').style.display = 'block';
							talk(2, '久等了！您的数字分身已经正式创建完毕！现在您可以穿越任意门，开启激动人心的旅程了！祝您好运！')
						});
					});
				}
			}

			function main() {
				init();
				move(0);
			}

			window.onload = main;
		</script>
	</head>
	<body>
		<header>
			<a id="home"></a>
			<div id="title">Anydoor</div>
		</header>
		<div class="page" id="page1">
			<div class="content"></div>
			<button>开启</button>
		</div>
		<div class="page" id="page2">
			<div class="content">
				<div id="progress" data-title="">
					<div class="bar"></div>
				</div>
				<a id="clear"></a>
				<img id="input"></img>
				<input id="uploader" type="file" accept="image/*" />
				<div id="narration2" class="narration"></div>
			</div>
			<button id="btn2">立即出发</button>
		</div>
		<div class="page" id="page3">
			<div class="content">
				<img id="result"></img>
				<div id="narration3" class="narration"></div>
			</div>
			<button id="btn3">前往下一站</button>
		</div>
	</body>
</html>
